import React from 'react';
import {YouTubePlayer} from 'react-video-players';

const VideoPlayer = () => {
    render()
    {
        return (
            <div>
                <YouTubePlayer videoId="https://www.youtube.com/watch?v=nSWt0CqMYDg"/>
            </div>
        );
    };
};

export default VideoPlayer;
